PHP updating multiple elements of sub-array of MongoDB document<p>I have the following document structure. I am trying to update specific values inside the holes sub-array:</p>
<p><a href="https://i.stack.imgur.com/vTxjF.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/vTxjF.png" alt="round document" /></a></p>
<p>Each <code>holes</code> Array element is an Object representing the score on a golf hole, with various properties (fields). I am trying to provide the ability to update the <code>holeGross</code> field ONLY for each score. On my PHP website, this is using a POST form, which pushes an Array of scores and the <code>round._id</code> value too, as:</p>
<pre><code>Array ( [holeScoreHidden] =&gt; Array ( [1] =&gt; 7 [2] =&gt; 7 [3] =&gt; 7 [4] =&gt; 8 [5] =&gt; 7 [6] =&gt; 7 [7] =&gt; 7 [8] =&gt; 7 [9] =&gt; 7 ) [roundId] =&gt; 60c642db09080f1b50331b2d [submit] =&gt; )
</code></pre>
<p>I have had some assistance on the MongoDB forums, with MongoDB-native (i.e. shell) syntax which I have tested in Compass and works:</p>
<pre><code>[{$match: {
  _id: ObjectId('60c916684bd16901f36efb3a')
}}, {$set: {
  holes: {
    $map: {
      input: { $range: [0, { $size: &quot;$holes&quot;}]},
      in: {
        $mergeObjects: [
            { $arrayElemAt: [&quot;$holes&quot;, &quot;$$this&quot;] },
            { holeGross: { $arrayElemAt: [[9,8,7,6,5,4,3,2,1], &quot;$$this&quot;] } }
          ]
      }
    }
  }
}}]
</code></pre>
<p>Using this as a basis, I tried converting to PHP-equivalent, as follows:</p>
<pre><code>function setRoundScores($roundId, $scoresArray) {

    $collection = $client-&gt;golf-&gt;roundTest;

    $match = [ '_id' =&gt; new MongoDB\BSON\ObjectID( $roundId ) ];

    $set = [
        '$set' =&gt; [
            'holes' =&gt; [
                '$map' =&gt; [
                    'input' =&gt; [
                        '$range' =&gt; [ 0, [ '$size' =&gt; '$holes']],
                        'in' =&gt; [
                            '$mergeObjects' =&gt; [
                                [ '$arrayElemAt' =&gt; [ '$holes', '$$this' ]],
                                [ 'holeGross' =&gt; [ '$arrayElemAt' =&gt; $scoresArray, '$$this' ]]
                            ]
                        ]
                    ]
                ]
            ]
        ]
    ];

    $updateOne = $collection-&gt;updateOne($match,$set);

    return $updateOne-&gt;getUpsertedId();

}
</code></pre>
<p>But this errors with:</p>
<blockquote>
<p>Fatal error: Uncaught MongoDB\Driver\Exception\BulkWriteException: The dollar ($) prefixed field '$map' in 'holes.$map' is not valid for storage. in /var/www/html/vendor/mongodb/mongodb/src/Operation/Update.php:228 Stack trace: #0 /var/www/html/vendor/mongodb/mongodb/src/Operation/Update.php(228): MongoDB\Driver\Server-&gt;executeBulkWrite('golf.roundTest', Object(MongoDB\Driver\BulkWrite), Array) #1 /var/www/html/vendor/mongodb/mongodb/src/Operation/UpdateOne.php(117): MongoDB\Operation\Update-&gt;execute(Object(MongoDB\Driver\Server)) #2 /var/www/html/vendor/mongodb/mongodb/src/Collection.php(1075): MongoDB\Operation\UpdateOne-&gt;execute(Object(MongoDB\Driver\Server)) #3 /var/www/html/functions.php(803): MongoDB\Collection-&gt;updateOne(Array, Array) #4 /var/www/html/updateRound.php(19): setRoundScores('60cb07d14bd1690...', Array) #5 {main} thrown in /var/www/html/vendor/mongodb/mongodb/src/Operation/Update.php on line 228</p>
</blockquote>
<p>I am getting very confused as to the equivalent syntax, or even if the same methods are available in the PHP driver?</p>
<p>Can anyone point out the syntax issues / errors?</p>
<p>Finally, could I simply replace the entire <code>holes</code> sub-array, and provide that as a whole var to the <code>updateOne()</code> call? This would send much more data and is not the most efficient obviously...</p>
<p>*** UPDATE ***</p>
<p>@Joe was of great help in the final answer. @Joe provided a single line covering what was the cause of the issue.</p>
<p>For posterity, I thought to repost the final syntax of my function for others to be able to follow:</p>
<pre><code>function setRoundScores($roundId, $scoresArray) {

    $client = new MongoDB\Client($_ENV['MDB_CLIENT');

    $collection = $client-&gt;golf-&gt;round;

    $match = [ '_id' =&gt; new MongoDB\BSON\ObjectID( $roundId ) ];

    $set = [
        '$set' =&gt; [
            'holes' =&gt; [
                '$map' =&gt; [
                    'input' =&gt; [
                        '$range' =&gt; [ 0, [ '$size' =&gt; '$holes']]
                    ],
                    'in' =&gt; [
                        '$mergeObjects' =&gt; [
                            [ '$arrayElemAt' =&gt; [ '$holes', '$$this' ]],
                            [ 'holeGross' =&gt; [ '$toInt' =&gt; [ '$arrayElemAt' =&gt; [ $scoresArray, '$$this' ]]]]
                        ]
                    ]

                ]
            ]
        ]
    ];

    $updateOne = $collection-&gt;updateOne($match, [$set]);

    return $updateOne-&gt;getModifiedCount();

}
</code></pre>
<p>Of note, also needed to cast the $_POST array's fields to Int's as they are converted to Strings, so using the '$toInt' method to perform this on the DB as well. Lots of extra square braces...</p>
<p>Also this is not an <code>upsert</code> so just returning the modified count instead.</p>

