I have these documents:</p>
<pre><code>{
   userId: 123,
   event: 'A',
   properties: {
     status: 'Sent'
   }
}
{
   userId: 123,
   event: 'B',
   properties: {
     status: 'Opened'
   }
}
{
   userId: 123,
   event: 'C',
   properties: {
     status: 'Clicked'
   }
}
</code></pre>
<p>I need a query to match all <code>userId == 'A'</code>, that also registered for event 'B', but has not done event 'C' with <code>properties.status == &quot;Clicked&quot;</code>.</p>
<p>Here's what I did so far:</p>
<pre><code>db.collection.aggregate([
{ $match: { &quot;event&quot;: &quot;A&quot;} },
{
    $lookup: {
        from: &quot;collection&quot;,
        let: { &quot;userId&quot;: &quot;$userId&quot; },
        pipeline: [{
            $match: {
              $expr: { $eq: [&quot;$userId&quot;, &quot;$$userId&quot;] } 
            }
        }],
        as: &quot;events&quot;
    }
}
</code></pre>
<p>This gives me this unified output:</p>
<pre><code>{
   userId: 123,
   event: &quot;A&quot;,
   properties: {
     status: 'Sent'
   },
   events: [
     { event: 'A' /* and all the other fields from original document */ },
     { event: 'B' /* and all the other fields from original document */ },
     { 
       event: 'C', 
       properties: {
         status: 'Clicked'
       }
     },
   ]
</code></pre>
<hr />
<p>I tried to do this next, but it didn't work:</p>
<pre><code>{
    $match: {
        $expr: {
            $not: {
                $and: [
                    { $eq: [&quot;$events.event&quot;, &quot;C&quot;] },
                    { $eq: [&quot;$events.properties.status', 'Clicked'] }
                ]
            }

        }
    }
}
</code></pre>
<hr />
<p>My expectation is that this query <strong>does not</strong> brings me <code>userId: 123</code> in this case, but it's on the results.</p>
<p>Can someone please help me with that?
Tks!</p>; Answer: Couldn't you just pass `$param` to the `$PDOStatement->execute($param);` statement?

