How to conditionally include/exclude a field from a query in Mongoose?<p>I have the following mongoose schema:</p>
<pre><code>export class Auction {
    ... Some other fields ...    

    @Prop({ type: mongoose.Schema.Types.ObjectId, ref: User.name, required: true, index: true })
    seller!: string | User | Types.ObjectId

    @Prop({
        type: [{
            bidderId: { type: Types.ObjectId, required: true, select: false },
            amount: { type: Number, required: true },
            date: { type: Date, required: true }
        }],
        select: false
    })
    bids?: Bid[]
}
</code></pre>
<p>I need an endpoint method that returns the <code>bids</code> of an <code>Auction</code>, but with the following rule:</p>
<p>include <code>bids.bidderId</code> if the user who's requesting the bids is the seller of the auction, else exclude <code>bids.bidderId</code> from the projection.</p>
<p>How can I implement that? assuming I have this method:</p>
<pre><code>async getBidsOfAuction(auctionId: string, user: UserDocument) {
  // In case user.id === auction.seller, return all the fields including bids.bidderId
    return await this.auctionModel.findOne({_id: auctionId, seller: user.id}).select('+bids +bids.bidderId') 
 // else, exclude bids.bidderId
    return await this.auctionModel.findById(auctionId).select('+bids')
}
</code></pre>
<p>I just can't know if <code>auction.seller === user.id</code> before I query the auction, and I don't want to manually (in JS) remove <code>bids.bidderId</code> from the bids array after the query because its seems redundant.</p>
<p>Is there a way to conditionally query <strong>If the auction's seller equals to the user id, include <code>bids.bidderId</code>, else exclude</strong>?</p>

